import './App.css';
import { Route, BrowserRouter, Routes } from "react-router-dom";
import Home from './components/Home/Home.jsx';

function App() {
  return (
    <BrowserRouter>
      <Routes>
      <Route path='/home' element={<Home/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
